 on demand call

*/
const Grosery = lazy(() => import("./Grosery"))

const About = lazy(() => import("./About"))

// You can replace with API respose
const events = [
    { id: 1, title: 'Meeting', date: '2024-05-16',description:'Some random description' },
    { id: 2, title: 'Party', date: '2024-06-20', description:'Some random description' },
    { id: 3, title: 'Party', date: '2024-07-02', description:'Some random description' },
    // Add more events as needed
  ];

const SwigyApp = () => {
    return (
        <Provider store={appStore}>
        <div className="appLayout">
            <HeaderComponent />
            <Outlet />
        </div>
        <div>

      </div>
        </Provider>
    )
}

const amarRouter = createBrowserRouter([
    {
        path: "/",
        element: <SwigyApp />,
        children: [
            {
                path: "/",
                element: <Body />,
            },
            {
                path: "/about",
                element: <Suspense><About /></Suspense>,
            },
            {
                path: "/contact",
                element: <Contact />,
            },
            {
                path: "/cart",
                element: <Cart />,
            },
            {
                path: "/grosery",
                element: <Suspense><Grosery /></Suspense>,
            },
            {
                path: "/restorents/:resId",
                element: <Restorentmenu />
            }

        ],
        errorElement: <Error />,
    },

]);
// const root = ReactDom.createRoot(document.getElementById("root"));
//root.render(<SwigyApp/>);

// root.render(<RouterProvider router={amarRouter} />)
//root.render(amar);


export default function App() {
    return (
        <RouterProvider router={amarRouter} />
    )
}
